import React from 'react'
import AliceCarousel from 'react-alice-carousel';
import "react-alice-carousel/lib/alice-carousel.css";

export default function Home() {
  return (
    <div>
      {/* Slider Carousel used react-alice-carousel */}
      <section className=''>
      <AliceCarousel autoPlay autoPlayInterval="3000">
      <img src="images/homepage1.webp" className="w-full h-auto object-fit "/>
      <img src="images/homepage2.webp" className="w-full h-auto object-fit "/>
      <img src="images/homepage3.webp" className="w-full h-auto object-fit "/>
</AliceCarousel>
      </section>
    </div>
  )
}
